import React,{useState} from "react";
import axios from "axios";
import { useNavigate } from "react-router-dom";
const AddItem =()  =>{
    const navigate = useNavigate()
    const [name,setQuantety] = useState('')
    const [quantety,setName] = useState('')
    const [value,setValue] = useState('')

    const name_change_handler =(event)=>{ setName(event.target.value)}
    const quantety_change_handler =(event)=>{ setQuantety(event.target.value)}
    const value_change_handler =(event)=>{ setValue(event.target.value)}

    const accessToken = localStorage.getItem('accessToken');
    const handleSubmit = async (event) =>{
        event.preventDefault()
        try{
            const request = await axios.post('http://localhost:3000/agents/add_item',{
                name, value, quantety
            })
            localStorage.setItem('accessToken', request.data.acess_token);
            console.log(request.data.acess_token)
            navigate("/home")

        }catch(error){
            console.log(error)
        }

    }

    return(
        <div>
            <div></div>
            <div>
            <div className="card">
            <h1 className="card-header">Add item</h1>
            <form onSubmit={handleSubmit}> 
            <div className="card-content">
                <label>Nome</label>
                <input type="text" value={name} onChange={name_change_handler}></input>
            </div>

            <div className="card-content">
                <label>Valor</label>
                <input type="number" value={value} onChange={value_change_handler}></input>
            </div>

            <div className="card-content">
                <label>Quantidade</label>
                <input type="number" value={quantety} onChange={quantety_change_handler}></input>
            </div>

            <div className="card-footer">
                <button type="submit">Add</button>
            </div>
            </form>
        </div>
            </div>
        </div>
    )
}

export default AddItem
